var city_data_arr = {};
// 获取 省 市 区 的地址名
function get_province(id){
	for (var raw in cityData3) {
		raw = cityData3[raw];
		if(raw.value == id){
			city_data_arr.province = raw;
			return city_data_arr;
		}
	}
	return city_data_arr;
}
function get_city(province_id,id){
	get_province(province_id);
	if(city_data_arr.province){
		for (var raw in city_data_arr.province.children) {
			raw = city_data_arr.province.children[raw];
			if(raw.value == id){
				city_data_arr.city = raw;
				return city_data_arr;
			}
		}
	}

	return city_data_arr;
}

function get_district(province_id,city_id,id){
	get_city(province_id,city_id);
	if(city_data_arr.city){
		for (var raw in city_data_arr.city.children) {
			raw = city_data_arr.city.children[raw];
			if(raw.value == id){
				city_data_arr.district = raw;
				return city_data_arr;
			}
		}
	}

	return city_data_arr;
}
